import React from "react";

function Test() {
    let getset = "hello";
    let getset1 = "world";
    let getset2 = "This is React";

  return (
    <>
      <h1>This is the Heading Tag</h1>
      <br />
      <ol>
        <li>{getset}</li>
        <li>{getset1}</li>
        <li>{getset2}</li>
      </ol>
    </>
  );
}
export default Test;
